import React from "react";
import {
  Text,
  Dimensions,
  Image,
  ScrollView,
  View,
  TouchableOpacity,
  StyleSheet,
} from "react-native";
import { useSafeAreaInsets } from "react-native-safe-area-context";


const Home =({ navigation })=> {
  const edges = useSafeAreaInsets();

  return (
    <View>
      <ScrollView>
        <View
          style={{
            paddingLeft: 15,
            paddingRight: 15,
            paddingTop: edges.top + 0,
            paddingBottom: 25,
          }}
        >
          <View style={styles.imageContainer}>
            <TouchableOpacity >
              <Image
                source={require("../../assets/images/welcomeImg.png")}
                style={{
                  width: Dimensions.get("window").width - 90,
                  height: 250,
                  borderRadius: 15,
                  marginTop: 20,
                }}
              ></Image>
            </TouchableOpacity>
          </View>

          <View style={styles.textContainer}>
            <Text style={styles.welcomeText}>Welcome!</Text>
            <Text style={styles.loginText}>Login With Your Credential</Text>
          </View>

          <View
            style={{
              marginTop: 60,
            }}
          >
                      <View >
          <TouchableOpacity
               onPress={() => navigation.navigate("AdminLogin", { screen: "AdminLogin" }) }

                style={{
                  justifyContent: "center",
                  alignItems: "center",
                  padding: 15,
                  width: "100%",
                  marginVertical: 5,
                  borderRadius: 50,
                  marginBottom: 0,
                  fontWeight: "bold",
                  backgroundColor: "#5062BD",
                  elevation: 4,
                  marginTop: 50,
                }}
              >
                <Text
                  style={{
                    color: "white",
                    fontWeight: 'bold',
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                 >
                  Super Admin
                </Text>
              </TouchableOpacity>

              
              <TouchableOpacity
                // onPress={() => navigation.navigate("UserLogin", { screen: "UserLogin" }) }
                onPress={() => navigation.navigate("TeacherLandingPage", { screen: "TeacherLandingPage" }) }

                style={{
                  justifyContent: "center",
                  alignItems: "center",
                  padding: 15,
                  width: "100%",
                  marginVertical: 5,
                  borderRadius: 50,
                  marginBottom: 80,
                  fontWeight: "bold",
                  backgroundColor: "#fff",
                  elevation: 1,
                  marginTop: 50,
                }}
              >
                <Text
                  style={{
                    color: "black",
                    fontWeight: "bold",
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                 >
                  Admin
                </Text>
              </TouchableOpacity>

              <TouchableOpacity
                onPress={() => navigation.navigate("TeacherLoginScreen", { screen: "TeacherLoginScreen" }) }

                style={{
                  justifyContent: "center",
                  alignItems: "center",
                  padding: 15,
                  width: "100%",
                  marginVertical: 5,
                  borderRadius: 50,
                  marginBottom: 80,
                  fontWeight: "bold",
                  backgroundColor: "#fff",
                  elevation: 1,
                  marginTop: 50,
                }}
              >
                <Text
                  style={{
                    color: "black",
                    fontWeight: "bold",
                    justifyContent: "center",
                    alignItems: "center",
                  }}
                 >
                  Teacher
                </Text>
              </TouchableOpacity>
          </View>
          </View>
         
        </View>
      </ScrollView>
    </View>
  );
}

export default Home;

const styles = StyleSheet.create({
  imageContainer: {
    justifyContent: "center",
    alignItems: "center",
  },
  textContainer: {
    margin: 20,
  },
  welcomeText: {
    fontWeight: "bold",
    fontSize: 35,
    paddingBottom: 10
  },
  loginText: {
    fontWeight: "700",
    fontSize: 18,
    color: '#696969'
  },
  buttonStyle: {
    backgroundColor: "#5062BD",
  },
});
